import React from "react";
import Sidebar from "../components/Sidebar";
import Topbar from "../components/Topbar";
import StatCard from "../components/StatCard";
import ActionCard from "../components/ActionCard";
import { Box, Grid, Typography } from "@mui/material";

export default function Dashboard({ mode, setMode, lang, setLang, t }) {
  return (
    <Box sx={{ display: "flex" }}>
      <Sidebar t={t} />
      <Box sx={{ flex: 1, bgcolor: "background.default", minHeight: "100vh" }}>
        <Topbar t={t} lang={lang} setLang={setLang} mode={mode} setMode={setMode} />
        <Box sx={{ p: { xs: 2, md: 4 }, bgcolor: "background.default", minHeight: "100vh" }}>
          {/* MAIN SUPERHEADINGS */}
          <Typography variant="h4" fontWeight={700} sx={{ mb: 1 }}>
            {t.dashboardOverview}
          </Typography>
          <Typography variant="body1" mb={3} color="text.secondary">
            {t.dashboardOverviewSubtitle}
          </Typography>
          {/* STATS GRID */}
          <Grid container spacing={2} sx={{ mb: 2 }}>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.trainsReady} value="147" sublabel="180" icon="train" />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.maintenanceAlerts} value="8" sublabel={t.active} icon="build" />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.adDeadlines} value="3" sublabel={t.thisWeek} icon="timer" />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.systemHealth} value="98.2%" sublabel={t.uptime} icon="check_circle" />
            </Grid>
          </Grid>
          {/* QUICK ACTIONS */}
          <Typography variant="h6" fontWeight={700} mt={3} mb={1}>
            {t.quickActions}
          </Typography>
          <Typography color="text.secondary" mb={2} variant="body2">
            {t.quickActionsSubtitle}
          </Typography>
          <Grid container spacing={2} mb={4}>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.dataPrediction}
                description={t.dataPredictionDesc}
                icon="chart"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.maintenanceHub}
                description={t.maintenanceHubDesc}
                icon="build"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.trainAudit}
                description={t.trainAuditDesc}
                icon="audit"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.stablingStatus}
                description={t.stablingStatusDesc}
                icon="stabling"
              />
            </Grid>
          </Grid>
          {/* PRIORITIES AND STATUS PANELS */}
          <Grid container spacing={2}>
            <Grid item xs={12} md={4}>
              <Box sx={{ bgcolor: 'background.paper', p: 2, borderRadius: 2, boxShadow: 1, height: '100%' }}>
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.todaysPriorities}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {t.samplePriority1}<br />{t.samplePriority2}
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={12} md={4}>
              <Box sx={{ bgcolor: 'background.paper', p: 2, borderRadius: 2, boxShadow: 1, height: '100%' }}>
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.systemStatus}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {t.operational} / {t.secure}
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={12} md={4}>
              <Box sx={{ bgcolor: 'background.paper', p: 2, borderRadius: 2, boxShadow: 1, height: '100%' }}>
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.loginSuccessful}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {t.welcomeMessage}
                </Typography>
              </Box>
            </Grid>
          </Grid>
        </Box>
      </Box>
    </Box>
  );
}
